import styled from "styled-components";
import { Project } from "../../types/project";

const List = ({ projectData }: { projectData: Project[] }) => {
  return (
    <Wrap>
      {projectData.map((project) => (
        <Content key={project.id}>
          <div>
            <div>
              <Title>
                <h2>{project.title}</h2>
                <div>
                  <Link>
                    <a
                      href={project.link}
                      target="_blank"
                      rel="noopener noreferrer"
                    >
                      배포 링크
                    </a>
                  </Link>
                  <a
                    href={project.git}
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    <span>
                      <AiFillGithub color="black" size={20} />
                    </span>
                  </a>
                </div>
              </Title>
            </div>
            <Duration>
              <span>{project.date}</span>
              <p>
                {"("}
                {project.term}
                {")"}
              </p>
            </Duration>
            <img src={getImageSrc(project.id)} alt={project.title} />
            <Info>
              <span>
                <p>구현 기능</p> {project.role.join(", ")}
              </span>
              <span>
                <p>기술 스택</p> {project.skill.join(", ")}
              </span>
            </Info>
          </div>
          <button onClick={handleDetailView}>상세보기</button>
        </Content>
      ))}
    </Wrap>
  );
};

export default List;

const Lists = styled.div``;
const Content = styled.div``;
